void minclient::Font::init(SDL_Window* mainWindow_){
  mainWindow = mainWindow_;
  tex = new CTextureGL(texelData, 256, 256, 3);

  for(int i = 0; i < 256; i++){
    lookUpTableLetters[i][0] = float(i%16) / 16.0f;			// X position of current character
    lookUpTableLetters[i][1] = float(i/16) / 16.0f;			// Y position of current character
  }
}

void minclient::Font::glPrint(GLint x, GLint y, const char* const string, bool swapBuffer){
  if(!string){
    cout << "glPrint: empty string!" << endl;
    return;
  }

  if(y == AUTO){
    numLinesPrinted++;
    if( Engine::screenHeightGL - (numLinesPrinted * (Engine::fontSize + Engine::fontSize / 8)) < Engine::fontSize){
      numLinesPrinted = 1;
      resetSavedLines();
      glClear(GL_COLOR_BUFFER_BIT);  // clear screen
      swapBuffers();
      glClear(GL_COLOR_BUFFER_BIT);  // clear screen
      swapBuffers();
    }
    y = Engine::screenHeightGL - (numLinesPrinted * (Engine::fontSize + Engine::fontSize / 6));
  }

  if(savedLinesNumber + 1 < FONT_MAX_NUMBER_LINES){
    strncpy(savedLines[savedLinesNumber], string, FONT_MAX_LENGTH_PER_LINE - 2);
    // extra check to make sure it will never overrun
    savedLines[savedLinesNumber][FONT_MAX_LENGTH_PER_LINE - 1] = 0;

    savedLinesCoordinates[savedLinesNumber].x = x; 
    savedLinesCoordinates[savedLinesNumber].y = y;

    savedLinesNumber++;
  }

  if(swapBuffer){
    glPrintSavedLines();
    swapBuffers();
  }
}

void minclient::Font::swapBuffers(){
  SDL_GL_SwapWindow(mainWindow); 
}

void minclient::Font::resetNumLinesPrinted(){
  numLinesPrinted = 1;
}

void minclient::Font::glPrintSavedLines(){
#ifndef ANDROID
  glEnable(GL_BLEND);    // blending takes quite some time in android, so disable it there. 
#endif

  glBindTexture(GL_TEXTURE_2D, tex->getID());						
#ifndef ANDROID
  glMatrixMode(GL_PROJECTION);									     
  glPushMatrix();													             
  glLoadIdentity();												         
#endif

  float orthoMatrix[16];
  memset(orthoMatrix, 0, sizeof(orthoMatrix));
  Engine::calculateOrthoMatrix(0.0f, Engine::screenWidthGL, 0.0f, Engine::screenHeightGL, -1.0f, 1.0f, orthoMatrix);

#ifndef ANDROID
  glMultMatrixf(orthoMatrix);  
  glMatrixMode(GL_MODELVIEW);										        
  glPushMatrix();		  										       
  glLoadIdentity();		
#endif

  const int fontSize = Engine::fontSize;
  const int fontSizeDiv4 = fontSize / 4;
  const int fontSizeMinusFontSizeDiv4 = fontSize - fontSizeDiv4;    

  for(int i = 0; i < savedLinesNumber; i++){
    float offsetX = 0.0f;

    float cx;											
    float cy;										
    
    const size_t strlength = strlen(savedLines[i]);

    for(int j = 0; j < (int)strlength; j++){
      if(savedLetters >= FONT_MAX_LETTERS_ON_SCREEN)
        break;

      unsigned char letter = savedLines[i][j] - 32;

      // skip empty spaces
      if(letter != 0){
        cx = lookUpTableLetters[letter][0];           
        cy = lookUpTableLetters[letter][1];		

        savedVertices[savedLetters][0] = 0 + offsetX + savedLinesCoordinates[i].x;
        savedVertices[savedLetters][1] = 0 + savedLinesCoordinates[i].y;
        savedVertices[savedLetters][2] = fontSize + offsetX + savedLinesCoordinates[i].x;
        savedVertices[savedLetters][3] = 0 + savedLinesCoordinates[i].y;
        savedVertices[savedLetters][4] = savedVertices[savedLetters][2];
        savedVertices[savedLetters][5] = fontSize + savedLinesCoordinates[i].y;
        savedVertices[savedLetters][6] = savedVertices[savedLetters][4];
        savedVertices[savedLetters][7] = savedVertices[savedLetters][5];
        savedVertices[savedLetters][8] = savedVertices[savedLetters][0];
        savedVertices[savedLetters][9] = savedVertices[savedLetters][5];
        savedVertices[savedLetters][10] = savedVertices[savedLetters][8];
        savedVertices[savedLetters][11] = 0 + savedLinesCoordinates[i].y;

        savedTexCoords[savedLetters][0] = cx;
        savedTexCoords[savedLetters][1] = 1 - cy - 0.0625f;
        savedTexCoords[savedLetters][2] = cx + 0.0625f;
        savedTexCoords[savedLetters][3] = savedTexCoords[savedLetters][1];
        savedTexCoords[savedLetters][4] = savedTexCoords[savedLetters][2];
        savedTexCoords[savedLetters][5] = 1 - cy;
        savedTexCoords[savedLetters][6] = savedTexCoords[savedLetters][2];
        savedTexCoords[savedLetters][7] = savedTexCoords[savedLetters][5];
        savedTexCoords[savedLetters][8] = cx;
        savedTexCoords[savedLetters][9] = savedTexCoords[savedLetters][5];
        savedTexCoords[savedLetters][10] = cx;
        savedTexCoords[savedLetters][11] = savedTexCoords[savedLetters][1];  

        savedLetters++;
      }

      offsetX += fontSizeMinusFontSizeDiv4;      
    }
  }

  if(savedLetters > 0){
#ifndef ANDROID
    glEnableClientState(GL_VERTEX_ARRAY);
    glEnableClientState(GL_TEXTURE_COORD_ARRAY);
   
    glVertexPointer(2, GL_FLOAT, 0,savedVertices);
    glTexCoordPointer(2, GL_FLOAT, 0, savedTexCoords);   
    glDrawArrays(GL_TRIANGLES, 0, 6 * savedLetters);  

    glDisableClientState(GL_VERTEX_ARRAY);
    glDisableClientState(GL_TEXTURE_COORD_ARRAY);
#else
  glUseProgram(OpenGLES2stuff::programID);

  glVertexAttribPointer(OpenGLES2stuff::gPositionHandle, 2, GL_FLOAT, GL_FALSE, 0, savedVertices);
  glEnableVertexAttribArray(OpenGLES2stuff::gPositionHandle);

  glVertexAttribPointer(OpenGLES2stuff::gTexCoordHandle, 2, GL_FLOAT, GL_FALSE, 0, savedTexCoords);
  glEnableVertexAttribArray(OpenGLES2stuff::gTexCoordHandle);

  // Pass the matrix into the shader program.
  glUniformMatrix4fv(OpenGLES2stuff::uMatrixLocation, 1, false, orthoMatrix);

  // Set the active texture unit to texture unit 0.
  glActiveTexture(GL_TEXTURE0);
  glUniform1i(OpenGLES2stuff::uTextureUnitLocation, 0);
   
  glDrawArrays(GL_TRIANGLES,0,6 * savedLetters);  
#endif
  }

#ifndef ANDROID
  glMatrixMode(GL_PROJECTION);									       
  glPopMatrix();													     
  glMatrixMode(GL_MODELVIEW);										     
  glPopMatrix();									
#endif

#ifndef ANDROID
  glDisable(GL_BLEND);	
#endif
}

void minclient::Font::resetSavedLines(){
  savedLinesNumber = 0;
  for(int i = 0; i < FONT_MAX_NUMBER_LINES; i++){
    savedLines[i][0] = 0;
    savedLinesCoordinates[i].x = 0; 
    savedLinesCoordinates[i].y = 0;
  }

  savedLetters = 0;
}

